{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/datawisherws/customer-bev-sales-forecast-supermarket?scriptVersionId=137272615\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"8638879b","metadata":{"papermill":{"duration":0.009941,"end_time":"2023-07-19T14:55:35.576175","exception":false,"start_time":"2023-07-19T14:55:35.566234","status":"completed"},"tags":[]},"source":["Hi Everyone! I'm trying to analyse customer behavior and sales forecast for Supermarket dataset.\n","Hope everyone enjoy with my analysis :) If you have any suggestion, please feel free to comment.\n","\n","Let's start it!"]},{"cell_type":"markdown","id":"1ac1209f","metadata":{"papermill":{"duration":0.007706,"end_time":"2023-07-19T14:55:35.591948","exception":false,"start_time":"2023-07-19T14:55:35.584242","status":"completed"},"tags":[]},"source":["# Data Overview"]},{"cell_type":"markdown","id":"f8f89f9d","metadata":{"papermill":{"duration":0.007503,"end_time":"2023-07-19T14:55:35.607167","exception":false,"start_time":"2023-07-19T14:55:35.599664","status":"completed"},"tags":[]},"source":["## Context\n","Supermarkets are a convenient and popular way to shop for groceries and other necessities. They offer a wide variety of products and services, and they are typically located in convenient locations. By understanding the different needs of their customers, supermarkets can better meet those needs and provide a better shopping experience.\n"]},{"cell_type":"markdown","id":"65263e46","metadata":{"papermill":{"duration":0.00913,"end_time":"2023-07-19T14:55:35.623906","exception":false,"start_time":"2023-07-19T14:55:35.614776","status":"completed"},"tags":[]},"source":["## Table Information\n","We have 17 column in table which are :\n","1. Invoice id: Computer generated sales slip invoice identification number\n","2. Branch: Branch of supercenter (3 branches are available identified by A, B and C).\n","3. City: Location of supercenters\n","4. Customer type: Type of customers, recorded by Members for customers using member card and Normal for without member card.\n","5. Gender: Gender type of customer\n","6. Product line: General item categorization groups - Electronic accessories, Fashion accessories, Food and beverages, Health and beauty, Home and lifestyle, Sports and travel\n","7. Unit price: Price of each product in $\n","8. Quantity: Number of products purchased by customer\n","9. Tax: 5% tax fee for customer buying\n","10. Total: Total price including tax\n","11. Date: Date of purchase (Record available from January 2019 to March 2019)\n","12. Time: Purchase time (10am to 9pm)\n","13. Payment: Payment used by customer for purchase (3 methods are available – Cash, Credit card and Ewallet)\n","14. COGS: Cost of goods sold\n","15. Gross margin percentage: Gross margin percentage\n","16. Gross income: Gross income\n","17. Rating: Customer stratification rating on their overall shopping experience (On a scale of 1 to 10)"]},{"cell_type":"code","execution_count":1,"id":"c491a54f","metadata":{"execution":{"iopub.execute_input":"2023-07-19T14:55:35.643811Z","iopub.status.busy":"2023-07-19T14:55:35.641577Z","iopub.status.idle":"2023-07-19T14:55:37.283596Z","shell.execute_reply":"2023-07-19T14:55:37.281665Z"},"papermill":{"duration":1.654863,"end_time":"2023-07-19T14:55:37.286533","exception":false,"start_time":"2023-07-19T14:55:35.63167","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001